  }

  return (
      <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>Usuario</label>
            <input type="text" name="user" className="form-control" />
          </div>
          <div>
              <label>Contraseaña</label>
              <input type="password" name="pass" className="form-control" />
          </div>

          <button type="submit">Iniciar Sessión</button>
      </form>
  )
};
